css:
@-moz-document domain("tutorialspoint.com") {
 ::-webkit-scrollbar {
 	/* Width */
 	width: 1.2em!important;
 }

 /* Color of handle ___________________________________________________________________________*/

 ::-webkit-scrollbar-thumb {
 	background: #580303!important;
 	background-image: linear-gradient(to right, rgba(93, 6, 6, 0.95), rgba(255, 4, 4, 0.1)), url(https://image.ibb.co/hCq4n5/Carbon_Fiber_2.jpg)!important;
 	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(55, 55, 55, 1) 0 1px 0!important;
 	border-radius: 22px!important;
 	border: 1px solid rgba(0, 0, 0, .25)!important;
 }

 ::-webkit-scrollbar-thumb:hover {
 	background: #580303!important;
 	background-image: linear-gradient(to left, rgba(93, 6, 6, 0.95), rgba(255, 4, 4, 0.1)), url(https://image.ibb.co/hCq4n5/Carbon_Fiber_2.jpg)!important;
 	border-radius: 22px!important;
 	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
 }

 /* Color of Track ______________________________________________________________________________*/

 ::-webkit-scrollbar-track {
 	background: #170000!important;
 	box-shadow: inset 8px 0 13px rgba(0, 0, 0, .4), rgba(55, 55, 55, 1) 0 1px 0!important;
 	border: 1px solid rgba(0, 0, 0, .25)!important;
 }

 /* Color of handles at top and bottom ___________________________________________________________*/

 ::-webkit-scrollbar-button {
 	background: #4c0707!important;
 	box-shadow: inset 0 12px 13px rgba(0, 0, 0, 0.6), rgba(55, 55, 55, 1) 0 1px 0!important;
 }

 ::-webkit-scrollbar-button:hover {
 	border-radius: 22px!important;
 	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
 }
}

@-moz-document domain("tutorialspoint.com") {
/*__________________________________________________________________________________*/

* {
	text-decoration: none!important;
}

.dev-box h5,
.whtboard,
div.featured-box h4,
h1.thick-heading,
nav ul.nav-main li a
{
	text-transform: capitalize!important;
}

ul.chapters li a img,
ul.menu li a,
ul.menu li a:hover,
ul.cat-menu ul li,
.android img,
.chat-msg a.sendmsg,
.col-md-3,
.content img,
.footer-nav .iphone img,
.gsc-input-box,
.gsc-search-button-v2,
.gsc-search-button-v2:focus,
.gsc-search-button-v2:hover,
.l-btn-plain:hover,
.m-btn-plain-active,
.menu-active,
.microsoft img,
.more-btn,
.pages a,
.pages a.number,
.pages span,
.panel-body,
.panel-header,
.right-blog,
.search-widget,
.top-jobs,
.tp-content-widget .tp-content-viewmore a:hover,
.tut_profile .tut_rght h4 span,
.views,
.whtboard,
:focus,
div.featured-box,
ul.sprite li
{
	border: none!important;
	outline: none!important;
	box-shadow: none!important;
}

ppp.slick-list {
    overflow: visible;
}


/*___ Fonts ________________________________________________________________________*/

[style="font-size:20px;"] {
	font-size: 30px!important;
}

section.toggle>label,
.spanQ
{
	font-size: 28px!important;
}

.Q,
.qa_widget .qa_list h2,
.qa_widget .qa_post h1,
.qa_widget .qa_post_no_link h1,
.table>tbody>tr>td,
.tut_profile .tut_rght h2,
.whtboard,
div.featured-box h4,
li.heading,
li.sreading
{
	font-size: 21px!important;
}

.ace_editor,
.mui-col-md-6 label,
.ace-cobalt,
.qa_answer_widget .qa_answer_detail a,
.tut_profile .tut_rght .tut-title,
.tutorial-content p,
div.content p,
li,
p,
ul.toc>li a
{
	font-size: 19px!important;
}

.mui-appbar-home a svg {
    font-size: 18px!important;
}

.qa_answer_widget {
	font-size: 17px!important;
}

.qa_category span {
	font-size: 15px!important;
	line-height: 27px!important;
}

.ace-cobalt {
	line-height: 25px!important;
}

.table>tbody>tr>td {
	text-align: center;
	vertical-align: middle;
}

/*___ Remove Items _________________________________________________________________*/

.top-ad-heading,
._ap_apex_ad,
.adsbygoogle,
.bottomgooglead,
.course-box:after,
.enlarge img,
.google-right-ads,
.header-navbar .navbar-header .navbar-brand .brand-logo,
.rightgooglead,
.topgooglead,
div.simple-ad,
ul.social-icons {
	left: -9999px!important;
	position: absolute!important;
	top: -9999px!important;
}

/*___ Left/Right/Top/Bottom ________________________________________________________*/

.sidenav {
    margin-right: 11%!important;
}

.mui-col-md-6,
.tutorial-toc {
	margin-left: 12px;
	margin-right: 12px;
    margin-top: 22px;
}

.float-right {
    margin-right: 15%;
}

.layout-panel-east, .layout-panel-center,
#codebox .layout-split-west {
    top: 65px!important;
}

#codebox .tabs-header,
#codebox .layout-panel-center {
    top: 65px!important;
}

.mui-container .mui-col-md-3 {
    margin-top: -91px!important;
}

/*___ Margins ______________________________________________________________________*/

.col-md-3,
#sidebar-left,
.col-md-7,
.compete-exams,
.content-wrapper,
.mui-container .mui-col-md-3,
.question_section,
.row.featured-boxes,
.sidebar-right,
.slick-initialized .slick-slide,
.tp-slider,
.tp-vd-courses
{
	margin: 12px!important;
}

.mui-container-fluid {
	margin: 9rem 12px 12px!important;
}

/*___ Paddings _____________________________________________________________________*/

.left-menu .mui-dropdown__menu,
.col-md-3,
#sidebar-left,
.card,
.col-md-7,
.compete-exams,
.content-wrapper,
.mui-container .mui-col-md-3,
.row.featured-boxes,
.sidebar-right,
.slick-initialized .slick-slide,
.tp-slider,
blockquote,
pre.prettyprint,
pre.result
{
	padding: 12px!important;
}

selector {
	padding: 6px!important;
}

/*___ Heights ______________________________________________________________________*/

.left-menu .mui-dropdown__menu {
	max-height: none!important;
}

ppp {
	height: auto!important;
}

/*___ Widths _______________________________________________________________________*/

.left-menu .mui-dropdown__menu,
.container,
.content,
.content-wrapper,
.large,
.mui-container
{
	max-width: none!important;
}

selector {
	width: auto!important;
}

.container,
.content
{
	width: 98%!important;
}

.col-md-7 {
    width: 74.333333%;
}

.mui-col-md-6 {
    width: 73%!important;
}

.content-wrapper {
    width: 69.076%;
}

.mui-col-md-5 {
    width: 31.66667%;
}

.mui-container .mui-col-md-3 {
    width: 23%;
}

.col-md-3 {
    width: 15%!important;
}

.col-md-12.col-sm-12.col-xs-12 .col-md-3 {
    width: 23%!important;
}


.slick-initialized .slick-slide {
    width: 7%!important;
}


.left-menu .mui-dropdown__menu
{
	width: 47rem!important;
}

}

@-moz-document domain("tutorialspoint.com") {
/*__________________________________________________________________________________*/

a[href],
td span {
	color: #0ff!important;
	text-shadow: 1px 1px #000!important;
}

a[href]:visited {
	color: #fc79fc!important;
	text-shadow: 1px 1px #000!important;
}

/*__________________________________________________________________________________*/

ul.menu li a:hover,
.MathJax_MenuActive,
.menu-active,
.mui-col-md-6 h1,
.pages a.current,
.pages a.number:hover,
a[href]:hover span,
a[href]:hover,
input[type="checkbox"]:checked+label,
input[type="radio"]:checked+label,
tr:hover .ts
{
	color: #ff0!important;
	text-shadow: 1px 1px #000!important;
}

/*__________________________________________________________________________________*/

.MathJax_Menu,
#privacy-banner p,
.ace_text.ace_xml,
.add-to-cart-form,
.m-btn .l-btn-left .l-btn-text,
.magnifying-glass,
.menu-text,
.mui-col-md-6 li,
.mui-col-md-6 p,
.qa_answer_widget,
.qa_category span,
.ts,
.tut_profile .tut_rght h4 span,
.vid-options,
[style*="color:#545454;"],
blockquote,
div.content p,
pre.result,
table,
ul.menu li a,
p
{
	color: #fff!important;
	text-shadow: 1px 1px #000!important;
}

/*___ Khaki ________________________________________________________________________*/

.card-title,
.dev-box h5,
.imgs-title,
.main-title,
.mui-col-md-6 h1,
.mui-col-md-6 h2,
.mui-col-md-6 li.big-font,
.mui-col-md-6 th,
.mui-tabs__bar.mui-tabs__bar--justified>li>a,
.panel-title,
.top-trainer-desc p strong,
.tp-content-widget .tp-content-icons a div,
.tut_profile .tut_rght h2,
.whtboard,
div.featured-box h4,
footer h4,
h1.thick-heading
{
	color: #F0E890!important;
	font-weight: 700!important;
	text-shadow: 1px 1px #000!important;
}

/*___ Burlywood ____________________________________________________________________*/

.chat-msg a.sendmsg,
.crs-left-tagline,
.mui-col-md-6 h3,
.mui-col-md-6 h4,
.mui-col-md-6 p b,
.tut_profile .tut_rght .tut-title,
.views
{
	color: #e0b880!important;
	font-weight: 700!important;
	text-shadow: 1px 1px #000!important;
}

/*___ Sandy Brown __________________________________________________________________*/

.mui-col-md-6 h5,
.mui-col-md-6 h6,
.mui-col-md-6 label {
	color: #F0A060!important;
	font-weight: 700!important;
	text-shadow: 1px 1px #000!important;
}

/*___ Blue _________________________________________________________________________*/

.qa_answer_dtm,
.qa_published_dtm,
time {
	color: #07beff!important;
	font-weight: 700!important;
	text-shadow: 1px 1px #000!important;
}

/*___ Green ________________________________________________________________________*/

.card .mui-col-sm-6,
.mui-col-md-5,
p:first-child
{
	color: #07ff24!important;
	font-weight: 700!important;
	text-shadow: 1px 1px #000!important;
}

/*___ Red __________________________________________________________________________*/

selector {
	color: #ff0707!important;
	font-weight: 700!important;
	text-shadow: 1px 1px #000!important;
}

/*__________________________________________________________________________________*/

.categories:hover,
.categories:focus,
.categories,
input,
input[type=email],
input[type=number],
input[type=password],
input[type=search],
input[type=tel],
input[type=text],
select,
textarea {
	background-color: #1d0909!important;
	border-radius: 22px!important;
	color: #fff!important;
}

/*__________________________________________________________________________________*/

::selection {
	background: #ff9!important;
	color: #000!important;
}

pre ::selection {
	background: #ff9!important;
	color: #fff!important;
}

::placeholder {
	color: #f48f8f;
	opacity: 1;
}

/*___ Code _________________________________________________________________________*/

pre.result,
pre.prettyprint {
	font-size: 1.95em;
}

#code .ace_line .ace_constant {
    color: #ff8383;
}

.atn {
	color: #ff83ff;
}

.atv {
	color: #5f5;
}

#code .ace_line .ace_paren.ace_lparen,
.clo,
.opn,
.pun {
	color: #ffff91;
}

.ace-cobalt .ace_comment,
.com {
	color: #a9a5a5;
}

#code .ace_line .ace_keyword,
.kwd {
	color: #a4f7ff;
}

.ace_layer .ace-crimson-editor .ace_support.ace_type,
.ace_layer .ace-crimson-editor .ace_support.ace_class {
    color: #8e9aff;
}

.dec, .var {
    color: #f0f;
}

.lit {
	color: #03ffff;
}

#code .ace_line .ace_constant.ace_numeric {
    color: #fbff00;
}

.Q span,
i,
.pln {
	color: #ffdf6f!important;
}

.ace_gutter-cell,
#code .ace_line,
.Q,
.spanQ {
	color: #fff;
}

.Q .correct {
    color: #3eaa1c!important;
}

.Q .wrong {
    color: red!important;
}

#code .ace_line .ace_string,
.str {
	color: #f8f7f3;
}

.tag {
	color: #8f8fff;
}

.typ {
    color: #ff30ff;
}
}

@-moz-document domain("tutorialspoint.com") {
/*__________________________________________________________________________________*/

.nimbus-is-editor {
	background: url(https://image.ibb.co/hVmiOe/wallpaper_with_black_background_45_free_wallpaper.jpg)!important;
	background-attachment: fixed!important;
}

#devices {
    background: #8c8989;
}

/*___ Background Gray ______________________________________________________________*/

pre,
#footer,
#north,
.ace-cobalt,
.mui-appbar,
.navbar-semi-dark,
.panel-body.panel-body-noheader.layout-body,
footer,
header {
	background: #060505!important;
	background-color: #060505!important;
}

.ace-crimson-editor .ace_gutter,
.home-intro-sub,
.panel-header,
.tabs-header,
.tabs-tool,
.vid-options
{
	background: #0a0909!important;
	background-color: #0a0909!important;
}

.panel-body {
    background-color: #ffffff;
    color: #000000;
    font-size: 12px;
}

/*___ Background 0000 ______________________________________________________________*/

ul.toc>li a.videolink,
ul.cat-menu ul li:hover,
.cat-menu,
.ace-cobalt .ace_gutter,
.chat-msg a.sendmsg,
.col-md-3 .course-box,
.content-body,.content-bottom,.content-header,
.course_header,
.dev-box h5,
.gsc-input-box,
.job-desc h4,
.l-btn-plain-active,.l-btn-plain:hover,
.m-btn-plain-active,
.menu-active,.menu-shadow,
.mini-logo,
.more-btn,
.nav>li:hover,
.navbar-semi-dark .navbar-header,
.nxt-btn a:active,.nxt-btn a:hover,
.pages a,
.pages a.number,
.pages a.number:hover,
.pages span,
.panel-title,
.pre-btn a:hover,
.qa_category span,.qa_widget,
.right-menu a:hover,
.search-widget,
.slick-next,.slick-prev,
.srch-login-links a,
.sub-main-menu .sub-menuu div:hover,.sub-main-menu .viewall,
.top-jobs,
.tp-card,
.tp-content-widget .tp-content-viewmore a,.tp-home .tp-browse-more svg,.tp-primary-header:hover,
.tp-widget,
.tut_profile .tut_rght h4 span,
.views,
[style="background: #fffb09; font-weight: bold;"],
button.btn-responsive-nav,
div.feature-box div.feature-box-icon,div.featured-box,
div.footer-copyright,
header div.search button.btn-default,header nav ul.nav-main li a:hover,
li.heading,
th,
ul.top-menu li:hover
{
	background: rgba(0, 0, 0, 0)!important;
}

/*___ Background-color 0000 ________________________________________________________*/

ul.menu li a:hover,
.MathJax_MenuActive,
ul.maths li a,
.mui-dropdown__menu,
.ace_scroller,
.gsc-search-button-v2,
.gsc-search-button-v2:focus,
.gsc-search-button-v2:hover,
.menu,
ul.nav-top>li>a:hover
{
	background-color: rgba(0, 0, 0, 0)!important;
}

/*___ Highlight Background _________________________________________________________*/

[style="background-color: rgb(214, 214, 214);"],
tr:not(:first-child):hover,
ul.toc>li:not(.heading):not(.sreading):hover
{
	border-left-color: #232222!important;
	background: linear-gradient(to right, #38383842, #0000)!important;
}

.ace-crimson-editor .ace_gutter-active-line
{
	border-left-color: #232222!important;
	background: linear-gradient(to left, #a5af07, #000)!important;
}

.ace_gutter-cell.ace_info
{
	border-left-color: #232222!important;
	background: linear-gradient(to left, #6f0202, #000)!important;
}

.ace-crimson-editor .ace_marker-layer .ace_active-line
{
	border-left-color: #232222!important;
	background: linear-gradient(to right, #383838, #0000)!important;
}

/*__________________________________________________________________________________*/

code,
pre.prettyprint,
pre.result {
	background: #111!important;
	background: url(https://image.ibb.co/e8fWZk/red_carbon_pattern_by_mystica_264_d4ceu9m.png) #111!important;
	background: url(https://image.ibb.co/msdy5U/Red_Fabric.jpg) #111!important;
}

code {
	background: #FDFCE4!important;
	border: 1px solid #eec!important;
	font-size: 110%!important;
	padding: 3px 8px!important;
	white-space: pre-wrap!important;
}

/*__ Blue __________________________________________________________________________*/

.btn-default,
#banner-accept,
.button.accent-color,
.tp-btn,
.tp-home .tp-browse-more a
{
	background-image: linear-gradient(to bottom right, #043dda, #000)!important;
	border-radius: 10px!important;
	border: none!important;
	box-shadow: 1px 1px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
	color: #fff!important;
}

.btn-default:hover,
#banner-accept:hover,
.button.accent-color:hover,
.tp-btn:hover,
.tp-home .tp-browse-more a:hover
{
	background-image: linear-gradient(to bottom right, #154eeb, #000)!important;
	color: #ff0!important;
}
.btn-default:active,
#banner-accept:active,
.button.accent-color:active,
.tp-btn:active,
.tp-home .tp-browse-more a:active
{
	box-shadow: inset 2px 2px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
}

/*__ Orange ________________________________________________________________________*/

.tp-coding-ground a.tp-coding-btn {
	background-image: linear-gradient(to bottom right, #da3a04, #000)!important;
	border-radius: 10px!important;
	border: none!important;
	box-shadow: 1px 1px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
	color: #fff!important;
}

.tp-coding-ground a.tp-coding-btn:hover {
	background-image: linear-gradient(to bottom right, #eb4b15, #000)!important;
	color: #ff0!important;
}

.tp-coding-ground a.tp-coding-btn:active {
	box-shadow: inset 2px 2px 1px black, inset 2px 3px 5px rgba(0, 0, 0, 0.3), inset -2px -3px 5px rgba(255, 255, 255, 0.5)!important;
}

/*___ Plain Black __________________________________________________________________*/

.mui-container-fluid,
.col-md-3,
#sidebar-left,
.col-md-2,
.col-md-7,
.compete-exams,
.content-wrapper,
.mui-col-md-6,
.row.featured-boxes,
.selected-reading-boxes .col-md-3 .course-box,
.sidebar-right,
.tp-slider,
.tp-vd-courses,
.tutorial-toc
{
	background-color: #000!important;
	border-radius: 22px!important;
	border: 1px solid rgba(0, 0, 0, .25)!important;
	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(55, 55, 55, 1) 0 1px 0, 10px 10px 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
}

.mui-container-fluid:hover,
.col-md-3:hover,
#sidebar-left:hover,
.col-md-2:hover,
.col-md-7:hover,
.compete-exams:hover,
.content-wrapper:hover,
.mui-col-md-6:hover,
.row.featured-boxes:hover,
.selected-reading-boxes .col-md-3 .course-box:hover,
.sidebar-right:hover,
.tp-slider:hover,
.tp-vd-courses:hover,
.tutorial-toc:hover
{
	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0, 10px 10px 5px rgba(10, 10, 10, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
}

/*___ Plain ________________________________________________________________________*/

.MathJax_Menu,
.cat-menu,
.left-menu .mui-dropdown__menu,
.card,
.dev-box,
.menu,
.mui-container .mui-col-md-3,
.question_section,
.slick-initialized .slick-slide,
.tp-content-widget,
.tut_profile
{
	background-color: #111!important;
	border-radius: 22px!important;
	border: 1px solid rgba(0, 0, 0, .25)!important;
	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(55, 55, 55, 1) 0 1px 0, 10px 10px 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
}

.MathJax_Menu:hover,
.cat-menu:hover,
.left-menu .mui-dropdown__menu:hover,
.card:hover,
.dev-box:hover,
.menu:hover,
.mui-container .mui-col-md-3:hover,
.question_section:hover,
.slick-initialized .slick-slide:hover,
.tp-content-widget:hover,
.tut_profile:hover
{
	box-shadow: inset 0 0 5px rgba(0, 0, 0, .4), rgba(155, 155, 155, 1) 0 1px 0, 10px 10px 5px rgba(10, 10, 10, .4), rgba(155, 155, 155, 1) 0 1px 0!important;
}

/*___ Red Gradient _________________________________________________________________*/

#privacy-banner,
.activebar,
ul.nav-list li:hover,
ul.submenu li:hover
{
	background: linear-gradient(to bottom, #300202 0%, #590505 100%)!important;
	border-bottom: 1px solid #000!important;
	border-radius: 22px!important;
}

/*__ Blue Gradient _________________________________________________________________*/

section.toggle>label,
blockquote {
	background: linear-gradient(to bottom, #03193c, #000 100%)!important;
	border-bottom: 1px solid #000!important;
	border-radius: 22px!important;
}

/*__ Light Blue Gradient _________________________________________________________________*/

a.demo,
li.heading {
	background: linear-gradient(to bottom, #1ea2c9, #000 100%)!important;
	border-bottom: 1px solid #000!important;
}

/*__ Green Gradient ________________________________________________________________*/

.right-menu .mui-btn,
.tabs li.tabs-selected a.tabs-inner,
div.featured-box h4
{
	background: linear-gradient(to bottom, #15534d 0%, #000 100%)!important;
	border-bottom: 1px solid #000!important;
	border-radius: 22px!important;
	text-shadow: 1px 1px #555!important;
}

